import { createIcon } from "../icon/createIcon";

export const ChevronRightIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ChevronRightIcon">
    <path d="M2.5 1.334 3.462.5 9.5 6.059l-.019.017.019.017L3.448 11.5l-.948-.847 5.136-4.589L2.5 1.334z" />
  </svg>,
  "ChevronRight",
  "chevron right"
);
